import Training from "./training";
import TrainingAnimals from "./training-animals";
import Work from "./work";
import SpellwroughtTattoos from "./spellwrought-tattoos";

  
function Downtime(){
    return(
        <div className="downtime-container">
            <div class="activity">
                <img src="activity1.jpg" alt="Activity 1"></img>
                <div class="activity-details">
                    <h3>Activity 1</h3>
                    <p>Summary of Activity 1 goes here.</p>
                    <a href="/activity1">Learn More</a>
                </div>
            </div>
            <div class="activity">
                <img src="activity2.jpg" alt="Activity 2"></img>
                <div class="activity-details">
                    <h3>Activity 2</h3>
                    <p>Summary of Activity 2 goes here.</p>
                    <a href="/activity2">Learn More</a>
                </div>
            </div>
        </div>
    )
}

export default Downtime;
